import React from "react";
import Side from "../side/side";

const Setting = () => {
    return(
        <>
            <Side/>
            <div className="setting">
                <form id="form_for_setting">
                    <label id="Name">
                        <input type="text" name="Name" id="Name_setting"/>
                    </label>
                </form>
            </div>
        </>
    )
}

export default Setting
